import React from "react";
import Slots from "./Slots";

const Won = (S) => {  
    let x = Slots.x;
    let y = Slots.y;
    let z = Slots.z;
  
    return (
        <>
            <div className="slot_inner">
                <h1>{x}{y}{z}</h1>
                <h1>You have WON</h1>
                <hr></hr>
            </div>
        </>
    )
}

export default Won;
